import React from 'react'
import './widgets.css'

class Navbar extends React.Component{
    render(){
        return(
            <div>
                <div className='Navbar'>
                    <a href='#'>
                        about
                    </a>
                    <a href='#'>
                        work
                    </a>
                    <a href='#'>
                        resume
                    </a>
                </div>
            </div>
        );
    }
}

export default Navbar;
